// src/pages/StatusList.tsx
import React, { useEffect, useMemo, useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
  Alert,
  Typography,
  Box,
  TextField,
  CircularProgress,
  TablePagination,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogContentText,
  DialogActions,
  Button,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import RefreshIcon from '@mui/icons-material/Refresh';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';

/**
 * Tipagem b√°sica do usu√°rio/pilot ‚Äî ajuste conforme seu backend.
 */
interface IUser {
  id: number;
  username?: string;
  firstName?: string;
  lastName?: string;
  email?: string;
  role?: string;
  cpf?: string;
}

export const StatusList: React.FC = () => {
  const [users, setUsers] = useState<IUser[]>([]);
  const [filter, setFilter] = useState<string>('');
  const [error, setError] = useState<string | null>(null);
  const [message, setMessage] = useState<string | null>(null);

  // confirma√ß√£o de delete
  const [openConfirm, setOpenConfirm] = useState(false);
  const [selectedUser, setSelectedUser] = useState<IUser | null>(null);

  // pagina√ß√£o simples client-side
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  // fetch hooks
  const { doFetch: fetchUsers, data: dataFetch, error: fetchError, isLoading: isLoadingUsers } =
    useFetch<IUser[]>({ method: 'GET' });

  const { doFetch: deleteUserFetch, isLoading: isDeleting } = useFetch<{ message?: string }>({
    method: 'DELETE',
  });

  // Carregar usu√°rios
  const loadUsers = async () => {
    setError(null);
    setMessage(null);
    try {
      const result = await fetchUsers({ url: getURI(API.pilots) });
      setUsers(result || []);
    } catch (err: any) {
      setError(err!.message || 'Erro ao carregar usu√°rios');
    }
  };

  useEffect(() => {
    loadUsers();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  useEffect(() => {
    if (fetchError) {
      setError(fetchError!.message ? String(fetchError!.message) : 'Erro ao carregar usu√°rios');
    }
  }, [fetchError]);

  // filtro memoizado
  const filtered = useMemo(() => {
    if (!filter) return users;
    const f = filter.trim().toLowerCase();
    return users.filter(
      (u) =>
        [u.username, u.firstName, u.lastName].filter(Boolean).join(' ')
          .toLowerCase()
          .includes(f) ||
        (u.email!.toLowerCase().includes(f) || u.cpf!.includes(f)) ||
        String(u.id).includes(f),
    );
  }, [users, filter]);

  // pagina√ß√£o slice
  const paginated = useMemo(() => {
    const start = page * rowsPerPage;
    return filtered.slice(start, start + rowsPerPage);
  }, [filtered, page, rowsPerPage]);

  // abrir confirma√ß√£o
  const onRequestDelete = (user: IUser) => {
    setSelectedUser(user);
    setOpenConfirm(true);
  };

  const onCancelDelete = () => {
    setOpenConfirm(false);
    setSelectedUser(null);
  };

  const onConfirmDelete = async () => {
    if (!selectedUser) return;
    setError(null);
    setMessage(null);

    try {
      const url = getURI(`${API.insertUser}/${selectedUser.id}`);
      const result = await deleteUserFetch({ url });
      // removemos localmente ap√≥s sucesso
      setUsers((prev) => prev.filter((u) => u.id !== selectedUser.id));
      setMessage(result!.message || 'Usu√°rio removido com sucesso');
    } catch (err: any) {
      setError(err!.message || 'Erro ao remover usu√°rio');
    } finally {
      setOpenConfirm(false);
      setSelectedUser(null);
    }
  };

  const handleChangePage = (_: any, newPage: number) => setPage(newPage);
  const handleChangeRowsPerPage = (e: React.ChangeEvent<HTMLInputElement>) => {
    setRowsPerPage(parseInt(e.target.value, 10));
    setPage(0);
  };

  // Se desejar condicionar o bot√£o ao role do usu√°rio autenticado:
  // const currentUserRole = useAuth().user?.role; // adapte conforme seu auth hook/context
  // const canDelete = currentUserRole === 'admin';

  return (
    <Box>
      <Box display="flex" alignItems="center" justifyContent="space-between" mb={2}>
        <Typography variant="h5">Lista de Usu√°rios / Pilotos</Typography>

        <Box display="flex" gap={1} alignItems="center">
          <TextField
            size="small"
            placeholder="Filtrar por nome, email, CPF ou id..."
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
          />
          <IconButton onClick={() => loadUsers()} title="Atualizar">
            <RefreshIcon />
          </IconButton>
        </Box>
      </Box>

      {message && (
        <Alert severity="success" sx={{ mb: 2 }}>
          {message}
        </Alert>
      )}

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <Paper>
        <TableContainer>
          <Table size="small">
            <TableHead>
              <TableRow>
                <TableCell>ID</TableCell>
                <TableCell>Nome</TableCell>
                <TableCell>E-mail</TableCell>
                <TableCell>CPF</TableCell>
                <TableCell>Role</TableCell>
                <TableCell align="center">A√ß√µes</TableCell>
              </TableRow>
            </TableHead>

            <TableBody>
              {isLoadingUsers ? (
                <TableRow>
                  <TableCell colSpan={6} align="center">
                    <Box display="flex" alignItems="center" justifyContent="center" py={4}>
                      <CircularProgress />
                    </Box>
                  </TableCell>
                </TableRow>
              ) : paginated.length === 0 ? (
                <TableRow>
                  <TableCell colSpan={6} align="center">
                    Nenhum usu√°rio encontrado.
                  </TableCell>
                </TableRow>
              ) : (
                paginated.map((user) => (
                  <TableRow key={user.id}>
                    <TableCell>{user.id}</TableCell>
                    <TableCell>
                      {user.firstName && user.lastName
                        ? `${user.firstName} ${user.lastName}`
                        : user.firstName
                          ? `${user.firstName}`
                          : user.username}
                    </TableCell>
                    <TableCell>{user.email}</TableCell>
                    <TableCell>{user.cpf}</TableCell>
/*************  ‚ú® Windsurf Command üåü  *************/
                    <TableCell>{user.role ? user.role : '‚Äî'}</TableCell>
                    <TableCell>{user.role ?? '‚Äî'}</TableCell>
/*******  107558c8-dd92-48ec-aa78-1074a034673b  *******/
                    <TableCell align="center">
                      <IconButton
                        color="error"
                        onClick={() => onRequestDelete(user)}
                        disabled={isDeleting}
                        title="Excluir usu√°rio"
                      >
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))
              )}
            </TableBody>
          </Table>
        </TableContainer>

        <TablePagination
          component="div"
          count={filtered.length}
          page={page}
          onPageChange={handleChangePage}
          rowsPerPage={rowsPerPage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          rowsPerPageOptions={[5, 10, 25, 50]}
        />
      </Paper>

      {/* Dialog de confirma√ß√£o */}
      <Dialog open={openConfirm} onClose={onCancelDelete}>
        <DialogTitle>Confirmar exclus√£o</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Tem certeza que deseja excluir o usu√°rio{' '}
            <strong>
              {selectedUser ? `${selectedUser.firstName ?? selectedUser.username} ${selectedUser.lastName ?? ''}` : ''}
            </strong>{' '}
            (id: {selectedUser?.id})? Essa a√ß√£o remover√° tamb√©m o piloto associado.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={onCancelDelete} disabled={isDeleting}>
            Cancelar
          </Button>
          <Button onClick={onConfirmDelete} color="error" variant="contained" disabled={isDeleting}>
            {isDeleting ? 'Excluindo...' : 'Excluir'}
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
